import './App.css';
import ImageLinkForm from './components/ImageLinkForm';

class App extends Component {
  constructor() {
    super()
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }

  render() {
    return (
      <ImageLinkForm onInput={this.onInputChange}/>
    );
  }
}

export default App;
